import React, {useState} from 'react';
import Header from '../../components/Header';
import Sidebar from '../../components/Sidebar';
import Footer from '../../components/Footer';
import { useNavigate } from 'react-router-dom';

const EditManageReseller = ({ userInfo, handleLogout }) => {
    const navigate = useNavigate();

    const backManageReseller = () => {
        navigate('/superadmin/ManageReseller');
    };

    // Update profile
    const [chargerID, setChargerID] = useState('');
    const [transactionID, setTransactionID] = useState('');
    const [tagID, setTagID] = useState('');
    const [model, setModel] = useState('');
    const [type, setType] = useState('');
    const [vendor, setVendor] = useState('');
    const [gunConnetor, setGunConnetor] = useState('');
    const [maxCurrent, setMaxCurrent] = useState('');
    const [maxPower, setMaxPower] = useState('');
    const [socketCount, setsocketCount] = useState('');
    const [currentOrActiveUser, setCurrentOrActiveUser] = useState('');
    const [ip, setIP] = useState('');
    const [lat, setLat] = useState('');
    const [long, setLong] = useState('');
    const [shortDescription, setShortDescription] = useState('');
    const [chargerAccessibility, setChargerAccessibility] = useState('');
    const [unitPrice, setUnitPrice] = useState('');
    const [assignedUser, setAssignedUser] = useState('');
    const [assignedResellerID, setAssignedResellerID] = useState('');
    const [assignedClientID, setAssignedClientID] = useState('');
    const [wifiPassword, setWifiPassword] = useState('');
    const [createdDate, setCreatedDate] = useState('');
    const [createdBy, setCreatedBy] = useState('');
    const [modifiedDate, setModifiedDate] = useState('');
    const [modifiedBy, setModifiedBy] = useState('');
    const [status, setStatus] = useState('');
    const [errorMessage, setErrorMessage] = useState('');


    return (
        <div className='container-scroller'>
            {/* Header */}
            {/* <Header/> */}
            <Header userInfo={userInfo} handleLogout={handleLogout}/>
            <div className="container-fluid page-body-wrapper">
                {/* Sidebar */}
                <Sidebar/>
                <div className="main-panel">
                    <div className="content-wrapper">
                        <div className="row">
                            <div className="col-md-12 grid-margin">
                                <div className="row">
                                    <div className="col-12 col-xl-8 mb-4 mb-xl-0">
                                        <h3 className="font-weight-bold">Edit Manage Reseller</h3>
                                    </div>
                                    <div className="col-12 col-xl-4">
                                        <div className="justify-content-end d-flex">
                                            <button type="button" className="btn btn-success" onClick={backManageReseller}>Back</button>
                                        </div>
                                    </div>
                                </div>
                            </div>
                        </div>
                        <div className="row">
                            <div className="col-lg-12 grid-margin stretch-card">
                                <div className="card">
                                    <div className="card-body">
                                        <div class="col-12 grid-margin">
                                            <div class="card">
                                                <div class="card-body">
                                                    <h4 class="card-title">Manage Reseller</h4>
                                                    <form class="form-sample" onSubmit={editManageReseller}>
                                                        <div class="row">
                                                            <div class="col-md-6">
                                                                <div class="form-group row">
                                                                    <label class="col-sm-3 col-form-label">Reseller Name</label>
                                                                    <div class="col-sm-9">
                                                                        <input type="text" class="form-control" placeholder="Reseller Name" value={resellerName}  onChange={(e) => setResellerName(e.target.value)} required/>
                                                                    </div>
                                                                </div>
                                                            </div>
                                                            <div class="col-md-6">
                                                                <div class="form-group row">
                                                                    <label class="col-sm-3 col-form-label">Phone Number</label>
                                                                    <div class="col-sm-9">
                                                                        <input type="text" class="form-control" placeholder="Phone Number" pattern="[0-9]{10}" value={phoneNumber} onChange={(e) => setPhoneNumber(e.target.value)} required/>
                                                                    </div>
                                                                </div>
                                                            </div>
                                                        </div>
                                                        <div class="row">
                                                            <div class="col-md-6">
                                                                <div class="form-group row">
                                                                    <label class="col-sm-3 col-form-label">Email ID</label>
                                                                    <div class="col-sm-9">
                                                                        <input type="email" class="form-control" placeholder="Email ID" value={emailID}  onChange={(e) => setEmailID(e.target.value)} required/>
                                                                    </div>
                                                                </div>
                                                            </div>
                                                            <div class="col-md-6">
                                                                <div class="form-group row">
                                                                    <label class="col-sm-3 col-form-label">Address</label>
                                                                    <div class="col-sm-9">
                                                                        <textarea type="text" class="form-control" placeholder="Address" value={address} maxLength={150} onChange={(e) => setAddress(e.target.value)} required/>
                                                                    </div>
                                                                </div>
                                                            </div>
                                                        </div>
                                                        {errorMessage && <div className="text-danger">{errorMessage}</div>}
                                                        <div style={{textAlign:'center'}}>
                                                            <button type="submit" class="btn btn-primary mr-2">Add</button>
                                                        </div>
                                                    </form>
                                                </div>
                                            </div>
                                        </div>
                                    </div>
                                </div>
                            </div>
                        </div>
                    </div>
                    {/* Footer */}
                    <Footer />
                </div>         
            </div>    
        </div>
    );
};   

export default EditManageReseller
